func findDisappearedNumbers(nums []int) []int {
	counterMap := make(map[int]bool)
	res := []int{}
	for _, entry := range nums {
		if _, value := counterMap[entry]; !value {
			counterMap[entry] = true
		}
	}
	for i := 1; i <= len(nums); i++ {
		if _, ok := counterMap[i]; !ok {
			res = append(res, i)
		}
	}
	return res
}
